insert  into `prod`(`PROD_ID`,`USER_ID`,`PROD_TYPE`,`EFF_DATE`,`EXP_DATE`,`CREATE_DATE`,`PROD_NAME`,`CONTENT`,`CITY_ID`) values (33,3131,'null',NULL,'2015-09-30','2015-09-12 22:56:40','Application Cache Progress event (17 of 71) http://localhost:8080/PinBa/message/servNoticeMsg.html',NULL,'jsnanjing'),(34,3131,'partTime','2015-09-14','2015-09-30','2015-09-13 15:58:28','5k-8k南京市场销售','有意向直接打电话或投递简历\n联系李女士13951713646\n公平完善的晋升制度、积极愉快的工作氛围。\n\n薪资待遇：\n1、无责底薪2500-10000上不封顶 高提成 奖金 五险一金 年假 旅游 晋升空间\n\n2、一般月薪会根据个人能力而定，上不封顶。 朝八点半晚六,双休\n\n3、专业培训专员集中完善的带薪岗前培训：专业知识、客服技能、沟通技巧、商务礼仪、心理素质、职业素养、财经知识；\n\n4.高档写字楼，办公环境一流舒适，优秀者能快速晋升，月薪上万\n补助：年假，每年免费旅游，每月聚餐，生日聚会，年终物质奖，节假日福利（中秋节月饼，端午节粽子等等）\n\n晋升方向：\n1、理财经理—高级理财经理—团队经理—部门经理—城市经理—大区总监。\n2、公司内部选拔人才，晋升道路畅通，人才与公司共同成长。\n','jsnanjing'),(35,3131,'reqPartTime','2015-09-14','2015-09-30','2015-09-13 15:59:45','发布求职信息测试','这是一个测试','jsnanjing'),(36,3131,'partTime','2015-09-15','2015-09-30','2015-09-13 16:41:20','一手楼盘销售提供住宿2600 高提成','任职要求：\n1.男女不限 户口不限 学历不限（只要你有一颗激情奋斗的心，并付诸努力，我愿意给你一个展现自我的平台）；\n2.性格开朗 ，通话标准，沟通无障碍；\n3. 对房产销售有浓厚的兴趣，有志于投身该行业的发展，追求个人发展和高薪；\n4. 具备良好的沟通表达能力和团队合作精神，准确把握客户需求，思维敏捷，责任心强；\n5. 通过与客户进行有效沟通了解客户需求, 寻找销售机会并完成销售业绩；\n6. 定期与合作客户进行沟通,建立良好的长期合作关系。\n福利待遇：\n1、全面岗前房产业务基础知识培训； \n2、高提成 绩效奖 月度奖金 公司旅游 公司聚餐 年终奖金 各种福利等，年薪8-16万，绩效考核，多劳多得。\n3、完善的职业晋升计划及空间，公平公正的晋升机制；','jsnanjing'),(37,3131,'partTime','2015-09-15','2015-09-30','2015-09-13 16:43:09','南京大牌档诚聘服务员','岗位职责：\n1、按照领班安排认真做好桌椅、餐厅卫生，餐厅铺台，准备好各种用品，确保正常营业使用。\n2、接待顾客应主动、热情、礼貌、耐心、周到，使顾客有宾至如归之感；\n3、运用礼貌语言，为客人提供最佳服务，\n4、善于向顾客介绍和推销本餐厅饮品及特色菜点；\n5、配合领班工作，服从领班或以上领导指挥，团结及善于帮助同事工作；\n6、积极参加培训，不断提高服务技能','jsnanjing'),(38,3131,'partTime','2015-09-15','2015-09-30','2015-09-13 16:47:02','店长6000-8000元火锅','岗位职责：:\n1、接受总经理的指示和安排\n2、根据公司下达的经营指标、费用指标及总经理的工作要求，制定全面的实施方案和分步计划。\n3、计划和组织餐饮的推销活动，扩大餐饮销售的渠道，增加营业收入。\n4、全面负责酒店运行的计划、组织和管理工作，确保日常业务的正常开展。\n5、根据直属下级上报的指标经营情况进行方案调整和工作重心的转移计划。\n6、根据不同时期反馈的客人意见，指导部门负责人制定相应的培训计划，并检查执行情况。\n7、督导前厅、厨房负责人组织好餐饮服务工作，提高餐饮服务质量。\n8、研究餐饮市场的动态和顾客的需求，有针对性的开发和改善产品服务。','jsnanjing'),(39,3131,'reqPartTime','2015-09-15','2015-09-30','2015-09-14 20:56:42','er','工作内容er',NULL),(40,3117,'partTime','2015-09-15','2015-09-30','2015-09-15 23:07:02','四星标准酒店五险一金招服务员包吃住','任职要求：\n1、高中毕业或具有同等学历。\n2、有熟练的服务技能技巧和一定的应变能力，能妥善处理服务中出现的一般性问题。\n3、工作主动、热情、认真，责任心较强。\n4、身体健康，仪表端庄。\n5、年龄：30岁以下。\n\n福利待遇：\n1、试用期2500。\n2、提供工作餐，员工宿舍，每周40小时工作制。\n3、入职当月即开始缴纳五险一金。\n4、年终奖。（根据个人考勤考核结果发放）\n5、节日福利。',NULL),(41,3117,'partTime','2015-09-09','2015-09-30','2015-09-19 20:08:39','test','å·¥ä½åå®¹',NULL),(42,3117,'reqPartTime','2015-09-19','2015-09-30','2015-09-19 20:18:15','test','中言',NULL),(43,3117,'reqPartTime','2015-09-19','2015-09-30','2015-09-19 20:18:15','test','å·¥ä½åå®¹',NULL),(44,3131,'reqPartTime','2015-09-19','2015-09-30','2015-09-19 14:31:35','tet','工作内容',NULL);

