insert  into `user_char`(`USER_CHAR_ID`,`USER_ID`,`CHAR_ID`,`VALUE`,`CREATE_DATE`) values (10,3117,1,'13914736924','2015-09-06 16:12:12'),(11,3118,1,'','2015-09-06 17:12:15'),(12,3124,1,'13914736922','2015-09-07 22:40:43'),(13,3128,1,'13914736923','2015-09-07 23:19:31'),(14,3130,1,'13813823312',NULL),(15,3131,1,'13813823311',NULL),(16,3131,4,'秦淮区汉中路1号国际金融中心801室',NULL),(17,3131,8,'51100',NULL),(18,3131,9,'exhibition',NULL),(49,3131,3,'13813823311@qq.com',NULL),(50,3131,6,'http://www.hongdiancaifu.com/',NULL),(53,3131,10,'南京红点金融信息服务有限公司',NULL),(54,3131,28,' 红点金融信息服务有限公司，（简称“红点财富”）是一家第三方财富管理行业的新锐企业, 注册资本人民币五千万元，总部位于江苏南京新街口商业中心。公司拥有一支具备多年行业管理运营经验的高素质团队，集财富管理、信用风险评估与管理、信用数据整合服务、小额借款行业投资、P2P等业务于一体，秉承诚信、专业、创新经营理念，根据客户的家庭结构情况，财务数据状况，风险承受能力等不同因素，为客户量身定制合适的投资理财规划。\n红点财富拥有完善的风控体系和远远高于行业标准的风险控制技术。每一笔资金出借之前，红点财富金融安全中心千余名的风险控制人员会对借款人进行百分之百地实地考察和面对面的信用审核。以全面审核、彻底排查、确凿数据、多方征信四重保护以确保投资人的资金安全。\n红点财富以雄厚的实力，专业的团队，科学的管理，优质的服务为广大客户提供安全、稳定、专业的财富管理与财富增值规划，并致力于成为永远值得客户信赖的理财专家，与您共谋发展！\n公司已在江阴、宜兴、淮安、南京开设分公司，未来布局在全国范围内开设分公司，现公司高速发展，急需各类金融精英 、专业人才的加入。',NULL),(55,3117,10,'13914736924',NULL),(56,3117,3,'13914736924@qq.com',NULL),(57,3117,2,'male',NULL),(58,3117,21,'32',NULL);

