/* Function  structure for function  `seq_nextval` */

/*!50003 DROP FUNCTION IF EXISTS `seq_nextval` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `seq_nextval`(seq_name CHAR (30)) RETURNS int(11)
BEGIN
 UPDATE sys_seq SET LAST_NUMBER= CASE last_number WHEN 0 THEN LAST_INSERT_ID(START_BY) ELSE LAST_INSERT_ID(LAST_NUMBER+INCREMENT_BY) END WHERE seq_name=seq_name;
 RETURN LAST_INSERT_ID();
END */$$
DELIMITER ;

